import React from 'react';

const Announce = () => {
  return (
    <section className={"container"}>
      <div className="row">
        <div className="announce-detail col-12 col-lg-8"></div>
        <div className="list-announce col-12 col-lg-4"></div>
      </div>
    </section>
  );
};

export default Announce;
